import React,  {useState} from 'react'
import PropTypes from 'prop-types'



export default function Navbar(props) {

  //dark mode


  const bgcolorchange = ()=>{
    if(bgcolor.color === 'black'){
     setbgcolor({
      color: 'white',
      backgroundColor: 'black',
     })
     setbtntxt('Light mode')
    }
    else{
      setbgcolor({
        color: 'black',
        backgroundColor: 'white'
       })
       setbtntxt('Dark mode')
    }
  }

  const [bgcolor , setbgcolor] = useState({
    color: 'black',
    backgroundColor: 'white'
  })

  const [btntxt , setbtntxt] = useState('Dark mode')

  
// dark mode finish
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary" style={bgcolor}>
    <div className="container-fluid">
      <a className="navbar-brand" href="/">{props.title}</a>
      <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
          {/* <li className="nav-item">
            <a className="nav-link active" aria-current="page" href="/">Home</a>
          </li>
          <li className="nav-item">
            <a className="nav-link active" aria-current="page" href="/">{props.about}</a>
          </li>
          */}
        </ul>
        <div class="form-check form-switch" style={bgcolor}>
  <input class="form-check-input" onClick={bgcolorchange} type="checkbox" role="switch" id="flexSwitchCheckDefault"/>
  <label class="form-check-label" for="flexSwitchCheckDefault">{btntxt}</label>
</div>
      </div>
    </div>
  
  </nav>
  )
}

Navbar.propTypes = { title : PropTypes.string ,
                    about :  PropTypes.string  }
